        if (ticket.number != room.winningNumber) revert InvalidTicket();
        if (ticket.claimed) revert InvalidTicket();

        // Direct storage modifications to ensure claimed immediately
        playerTickets[roomId][msg.sender][0].claimed = true;
        ticket.claimed = true;

